import React, { useEffect, useRef } from 'react';
import { Chart, registerables } from 'chart.js';
import '../styles/MainContent.css'; // Import the matching CSS
Chart.register(...registerables);

export default function MainContent({ patient }) {
  const chartRef = useRef(null);

  // Sample data if patient data is not yet integrated:
  const sampleBloodPressure = [
    { month: 'Oct 2022', systolic: 160, diastolic: 80 },
    { month: 'Nov 2022', systolic: 155, diastolic: 82 },
    { month: 'Dec 2022', systolic: 158, diastolic: 79 },
    { month: 'Jan 2023', systolic: 162, diastolic: 84 },
    { month: 'Feb 2023', systolic: 159, diastolic: 81 },
    { month: 'Mar 2023', systolic: 160, diastolic: 78 },
  ];

  // Sample diagnostic list if patient data is not yet integrated:
  const sampleDiagnosticList = [
    {
      diagnosis: 'Hypertension',
      description: 'Chronic high blood pressure',
      status: 'Under Observation',
    },
    {
      diagnosis: 'Type 2 Diabetes',
      description: 'Insulin resistance and elevated blood sugar',
      status: 'Cured',
    },
    {
      diagnosis: 'Asthma',
      description: 'Recurrent episodes of bronchial constriction',
      status: 'Inactive',
    },
  ];

  // Use patient data if available, otherwise fall back to sample data
  const bloodPressureData = patient?.bloodPressureReadings || sampleBloodPressure;
  const diagnosticList = patient?.diagnosticList || sampleDiagnosticList;

  // Initialize Chart.js for Blood Pressure
  useEffect(() => {
    if (chartRef.current && bloodPressureData.length) {
      const labels = bloodPressureData.map((entry) => entry.month);
      const systolicValues = bloodPressureData.map((entry) => entry.systolic);
      const diastolicValues = bloodPressureData.map((entry) => entry.diastolic);

      new Chart(chartRef.current, {
        type: 'line',
        data: {
          labels,
          datasets: [
            {
              label: 'Systolic',
              data: systolicValues,
              borderColor: '#ff6fae', // Pink-ish
              backgroundColor: '#ff6fae',
              borderWidth: 2,
              fill: false,
              tension: 0.4,
              pointRadius: 4,
              pointBackgroundColor: '#ffffff',
              pointBorderColor: '#ff6fae',
            },
            {
              label: 'Diastolic',
              data: diastolicValues,
              borderColor: '#b19cd9', // Purple-ish
              backgroundColor: '#b19cd9',
              borderWidth: 2,
              fill: false,
              tension: 0.4,
              pointRadius: 4,
              pointBackgroundColor: '#ffffff',
              pointBorderColor: '#b19cd9',
            },
          ],
        },
        options: {
          responsive: true,
          maintainAspectRatio: false,
          plugins: {
            legend: {
              display: true,
              labels: {
                usePointStyle: true,
              },
            },
          },
          scales: {
            y: {
              beginAtZero: false,
              grid: {
                color: '#e0e0e0',
              },
            },
            x: {
              grid: {
                display: false,
              },
            },
          },
        },
      });
    }
  }, [bloodPressureData]);

  return (
    <div className="main-content">
      {/* Diagnosis History Section */}
      <div className="diagnosis-history">
        <div className="diagnosis-history-header">
          <h2>Diagnosis History</h2>
          <div className="history-range">Last 6 months</div>
        </div>

        {/* Blood Pressure Chart */}
        <div className="blood-pressure-chart">
          <canvas ref={chartRef} id="bpChart"></canvas>
        </div>

        {/* KPI / Stats Cards */}
        <div className="stats-cards">
          <div className="stats-card">
            <img
              src="https://via.placeholder.com/40/09f/fff.png?text=RR"
              alt="Respiratory Rate Icon"
              className="stats-icon"
            />
            <h3>Respiratory Rate</h3>
            <p>20 bpm</p>
            <span className="status normal">Normal</span>
          </div>
          <div className="stats-card">
            <img
              src="https://via.placeholder.com/40/f90/fff.png?text=°F"
              alt="Temperature Icon"
              className="stats-icon"
            />
            <h3>Temperature</h3>
            <p>98.6°F</p>
            <span className="status normal">Normal</span>
          </div>
          <div className="stats-card">
            <img
              src="https://via.placeholder.com/40/f00/fff.png?text=HR"
              alt="Heart Rate Icon"
              className="stats-icon"
            />
            <h3>Heart Rate</h3>
            <p>78 bpm</p>
            <span className="status lower">Lower than Average</span>
          </div>
        </div>
      </div>

      {/* Diagnostic List Section */}
      <div className="diagnostic-list">
        <h2>Diagnostic List</h2>
        <table>
          <thead>
            <tr>
              <th>Problem/Diagnosis</th>
              <th>Description</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {diagnosticList.map((diag, index) => (
              <tr key={index}>
                <td>{diag.diagnosis}</td>
                <td>{diag.description}</td>
                <td>{diag.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
